import styled from 'styled-components';


const S = {}

S.CheckboxWrapper = styled.div`
    display: inline-flex;
    cursor: pointer;
`

S.CheckboxWithLabelWrapper = styled.div`
  display: inline-flex;
  align-items: center;
  cursor: pointer;
`;

S.Label = styled.span`
  font-size: 18px;
  font-weight: 500;
  color: #000;
`;


export default S;
